import { Component } from '@angular/core';
import {CatalogComponent} from "./components/catalog/catalog.component";

@Component({
  selector: 'app-root',
  templateUrl: './app.component.html',
  styleUrls: ['./app.component.css'],
  imports: [
    CatalogComponent
  ]
})
export class AppComponent {
  title = 'skills';
}
